    // Mapping of accepted ERC-20 tokens
    mapping(address => bool) public acceptedTokens;

    // Transaction structure to log service purchases
    struct Transaction {
        address user;
        string phoneNumber;
        uint256 amount;
        string serviceType;
        string network;
        string dataPlan;
        string billType;
        uint256 timestamp;
        bool completed;
        address token;
    }

    // Storage for transactions
    mapping(uint256 => Transaction) public transactions;
    uint256 public transactionCounter;

    // Events
    event TokenAdded(address indexed token);
    event TokenRemoved(address indexed token);
    event AirtimePurchase(
        address indexed user,
        string phoneNumber,
        uint256 amount,
        string network,
        address token,
        uint256 timestamp
    );
    event Withdrawal(
        address indexed admin,
        address token,
        uint256 amount,
        uint256 timestamp
    );

    /**
     * @dev Constructor initializes the contract with an initial accepted token and sets the owner.
     * @param _usdcToken Address of the initial accepted token.
     */
